import React, { Component } from 'react';
import { buttons } from './components/buttons';
import Button from './components/Button';

class Calculator extends Component {
  render() {
    return (
      <div>
        <div>display</div>

        {buttons.map((buttonSing) => {
          return <Button buttonSing={buttonSing} />;
        })}
      </div>
    );
  }
}
